    return (
        <div id="pagerComponent">
            {previous && <div id="previousPagerController">
                <div>
                    <svg width="10" height="10" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M11 17L6 12L11 7" stroke="#A41A1A" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
                        <path d="M18 17L13 12L18 7" stroke="#A41A1A" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
                    </svg>

                </div> 
                <div>{previous}</div>
        </div>}
            <div>{current}</div>
            {next && <div id="nextPagerController"><div>{next}</div> <div>end</div></div>}
        </div>
    )
}
